import DropdownButton from 'react-bootstrap/DropdownButton';
import Dropdown from 'react-bootstrap/Dropdown';
import { json } from 'express';
import React, {useEffect, useState} from "react";

export default function MultiDropDown() {

    const[result, getData] = useState([]);

    useEffect(() => {

        fetch('/api/deviceType')
        .then(resp => resp.json())
        .then(resp => getData(resp))
    },[])

    console.log(getData);

    const[output, setData]=useState([]);

    const handle = (e) => {

        setData(e);
    }

    return (

        <div>
            <center>
                <DropdownButton id="dropdown-basic-button" title="Dropdown button" onSelect={handle}>

                {
                    result.map((items)=>{

                        return(

                            <Dropdown.Item eventKey = {items.name}>{items.name}</Dropdown.Item>
                        );
                    })
                }
                </DropdownButton>
                <h1>{output}</h1>
            </center>
        </div>
    )
}
